import React from 'react'
import Product from './Product'

function Frames() {
    return (
        <div className='store__frames'>

            <Product
                id='17'
                title='Zatwór wielkopolski gniazdowy zwykły'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={6}
                availble={true}
            />
            <Product
                id='18'
                title='Zatwór wielkopolski gniazdowy ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={12}
                availble={false}
            />



            <Product
                id='19'
                title='Zatwór wielkopolski 18 zwykły'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={5.5}
                availble={false}
            />
            <Product
                id='20'
                title='Zatwór wielkopolski 18 ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={10}
                availble={false}
            />



            <Product
                id='21'
                title='Zatwór wielkopolski 1/2 zwykły'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={5.5}
                availble={false}
            />
            <Product
                id='22'
                title='Zatwór wielkopolski 1/2 ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={10}
                availble={false}
            />



            <Product
                id='23'
                title='Zatwór warszawski zwykły'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={7.5}
                availble={false}
            />
            <Product
                id='24'
                title='Zatwór warszawski zwykły ocieplany'
                image='https://www.betterbee.com/images/adfbcomb_n.jpg'
                price={12}
                availble={false}
            />

        </div>
    )
}

export default Frames
